import React, {Component} from "react";
import {
  Text,
  View, 
  Image, 
  Dimensions, 
  ImageBackground,
  StyleSheet
} from "react-native";
import {Grid, Col, Row} from "react-native-easy-grid";
import {DashedProgress} from 'react-native-dashed-progress';
import {
  widthPercentageToDP as wp,
  heightPercentageToDP as hp,
  listenOrientationChange as loc,
  removeOrientationListener as rol
} from 'react-native-responsive-screen';
import { ScaledSheet } from 'react-native-size-matters';
import { s, vs, ms, mvs } from 'react-native-size-matters';

const { height, width } = Dimensions.get("window");

const Compasss =(props) => {
 
  _direction = degree => {
    if (degree >= 22.5 && degree < 67.5) {
      return "NE";
    } else if (degree >= 67.5 && degree < 112.5) {
      return "E";
    } else if (degree >= 112.5 && degree < 157.5) {
      return "SE";
    } else if (degree >= 157.5 && degree < 202.5) {
      return "S";
    } else if (degree >= 202.5 && degree < 247.5) {
      return "SW";
    } else if (degree >= 247.5 && degree < 292.5) {
      return "W";
    } else if (degree >= 292.5 && degree < 337.5) {
      return "NW";
    } else {
      return "N";
    }
  };

  return (
    <Grid >
      <ImageBackground 
        source={require('../images/safaa.png')} 
        style={{
          marginLeft: wp("4%"),
          width: wp("60%"),
          height: hp("42%"),
          position:"absolute",
        }}
      >
        <ImageBackground
          source={require("../images/DRTTT.png")}
          style={{
            height: hp("35%"),
            width: wp("45%"),
            marginLeft: wp("7.5%"),
            ///justifyContent: "center",
            /// alignItems: "center",
            marginTop: hp("5%"),
            //marginLeft:20,
            transform: [
              {rotate:180+ "deg"},
            ],
          }}
        >
          <View 
            style={{
              justifyContent: 'center', 
              alignItems: 'center',
              marginLeft: wp("18.5%"),
              marginTop: hp("13.5%"),
              width: wp("8%"),
              height: hp("8%"),
             transform: [{rotate:-180+ "deg"}]
            }}
          >
            <DashedProgress
                fill={props.dataa} //30%  50*30/100
                countBars={40} 
                radius={ wp("11%") }
                indicatorWidth={ wp("9%") }
                barWidth={ wp("5%")}
                strokeThickness={ wp("1%") }
                text={props.dataa+"Km/h"}
                showIndicator={false}
                trailColor="#8EBCE4"
                strokeColor="#3D57A7"
                tooltipSize={ wp("5%") }
                // strokeLinecap={}
                tooltipColor={"#3D57A7"}
                // tooltipFamily={}
            />
          </View>
        </ImageBackground>
      </ImageBackground>
    </Grid>
  );
}

export default Compasss;
